    // Sorted alphabetically by koen on 8.31.2024
    //
    // NOTE: Please keep this file alphabetically sorted and make sure every ZE map is in the list from "/cstrike/maps"
    // Don't forget to change the map name when updating the map.
    // Don't forget to post in the changelogs.
    //
    //  "example_map"
    //  {
    //      "MinTime"       "1800" // Min server time before a map becomes available for nomination (Example: map nomination is enabled at 18:00 server time)
    //      "MaxTime"       "2300" // Max server time before a map becomes unavailable for nomination (Example: map nomination is disabled at 23:00 server time)
    //      "MinPlayers"    "25"   // Min player count for a map to be available for nomination (Example: map nomination enabled if 25+ players on server)
    //      "MaxPlayers"    "50"   // Max player count for a map to be unavailable for nomination (Example: map nomination disabled if 50+ players on server)
    //      "CooldownTime"  "24h"  // Time-based cooldown (Example: map will be in cooldown for 24 hours after being played)
    //      "Cooldown"      "20"   // Map-based cooldown (Example: map will be in cooldown until 20 maps have been played)
    //      "VIP"           "1"    // Map can only be nominated by VIPs
    //      "Admin"         "1"    // Map can only be nominated by Admins
    //      "Leader"        "1"    // Map can only be nominated by Leaders
    //      "Extends"       "3"    // Numbers of extends available
    //      "ExtendTime"    "15"   // Duration of an Extend in minutes
    //      "ExtendRound"   "3"    // Numbers of rounds to extend
    //      "ExtendFrag"    "100"  // Numbers of frags to extend
    //      "TimeLimit"     "20"   // Time in minutes to enforce map time (mp_timelimit)
    //  }
    //
    // Run this mapchooser to bring back players. Let them enjoy the right to nominate the maps they want to play, when they want to play it.
    // CD must be adjusted carefully, don't add a big CD at start, increase the CD week after week to 5 maximum, can be day after day if the map is overplayed. 
    // Try to see what map bring players and what maps kills the servers and why.
    //
    // MAPS THAT KILLS SERVER:
    //
    // - is it a hard map? : add a mintime and max time when the server reach the maximum of players ( afternoon > just before the night, in France it's like 1600 > 2300, 4pm tp 11pm (for example))
    // - is it over played?: increasea bit the CD to 5, and increase it again if players still complain about this map, don't add mintime and maxtime on theses maps.
    // - Scuffed map ?: admin nomlist
    // - forget maxplayers, minplayers, group(s) and leader, it divides the playerbase especially when they are playing boatescape > mako > surf vortex, (for example).
    //
    // MAPS THAT BRING PLAYERS:
    //
    // - easy maps: don't add a CD until people start to complain about this map because it's over played.
    // - hard maps: why it brough players ? leader needed or not ? special time when it's played ? (1600 > 2300) then add a special time to be sure that the map will be played at the good time ONLY if the map doesn't need a leader.
    //
